import styled from "styled-components"

export default function Category(ion) {
    return(
        <Classe>
            <ion-icon name={ion}></ion-icon>
        </Classe>
    );
}
const Classe = styled.div`

    ion-icon {
        font-size: 30px;
        border-radius: 50%;
        background-color: #FFFFFF;
        color: #B3B3C3;
    }
`;
